import React, { Component } from 'react';
import logo from './Assets/Images/App/app-logo.png';
import './Styles/App.css';
import {BrowserRouter, Route} from 'react-router-dom';

import NavBar from './Components/PageLayout/Header/nav-bar';
import HomePage from './Pages/HomePage/home-page';
import Login from './Components/Popup/Form/login'
import SignUp from './Components/Popup/Form/sign-up'

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div className="App">
        <NavBar/>
          <h1>Welcome to Arcade Game</h1>
          <img src={logo} className="app-logo" alt="logo"/>

          <Route path="/" Component={HomePage}/>
          <Login/>
          <SignUp/>
        </div>  
      </BrowserRouter>
    );
  }
}

export default App;
